#home {
  width: 100%;
  height: 100%;
}
/* 地图 */
#container {
  width: 100%;
  height: 100%;
}
/* 地图侧边栏 */
.dian {
  width: 100px;
  height: 85%;
  position: absolute;
  left: 1.6%;
  top: 10%;
  z-index: 9999;
  cursor: pointer;
}
.hengd {
  width: 90px;
  height: 25px;
  border-radius: 0 100px 100px 0;
  margin-bottom: 10px;
  margin-top: 10px;
  color: #fff;
  font-size: 13px;
  line-height: 25px;
  text-align: right;
  padding-right: 10px;
  z-index: 9999;
  background: #1e3b88;
}
.hengd div {
  padding-right: 20px;
}
.hengd2 div {
  background: rgba(00, 00, 00, 0.5);
  width: 220%;
  height: 25px;
  margin-top: -25px;
  z-index: 9999;
  border-radius: 0 100px 100px 0;
  display: block;
  animation: dong1 0.5s;
  overflow: hidden;
}
@keyframes dong1 {
  0% {
    width: 0%;
    color: #000;
  }
  100% {
    width: 220%;
    color: #fff;
  }
}
.hengd1 div {
  display: none;
}
/* 报警信息 */
.baoc {
  width: 45%;
  height: 100px;
  position: fixed;
  bottom: 6%;
  left: 1.6%;
  background: #fff;
  z-index: 1000000;
  padding: 1%;
  overflow: hidden;
  overflow-y: auto;
}
.baoc p {
  color: red;
  text-indent: 25px;
}
